import React from "react";
import Tile from "./Tile";


class Grid extends React.Component {

	constructor(props) {
		super(props);
		Grid.instance = this;
		this.width = props.width + "px";
		this.height = props.height + "px";
		this.state = { }
	}

	render()
	{
		return(
			<div style={{width: this.width, height: this.height, border:"1px solid black"}}>
				<Tile x="0" y="0" label="_0" />
				<Tile x="1" y="0" label="_0" />
				<Tile x="2" y="0" label="_0" />
				<Tile x="3" y="0" label="_0" />
				<Tile x="0" y="1" label="_0" null="true"/>
				<Tile x="1" y="1" label="_0" />
				<Tile x="2" y="1" label="_0" />
				<Tile x="3" y="1" label="_0" />
				<Tile x="0" y="2" label="_0" />
				<Tile x="1" y="2" label="_0" />
				<Tile x="2" y="2" label="_0" />
				<Tile x="3" y="2" label="_0" />
				<Tile x="0" y="3" label="_0" />
				<Tile x="1" y="3" label="_0" />
				<Tile x="2" y="3" label="_0" />
				<Tile x="3" y="3" label="_0" />
			</div>
			);
	}
}

	export default Grid;
